    "Qualitative Event-based Diagnosis with Possible Conflicts Applied to Spacecraft
    Power Distribution Systems",nt"tracking_summary": {ntt"total": 3,ntt"recent":
    0nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-02-26T22:03:54.706880",nt"name": "qualitative-event-based-diagnosis-with-possible-conflicts-applied-to-spacecraft-power-dist",nt"isopen":
    true,nt"url": null,nt"notes": "Model-based diagnosis enables efficient
    and safe operation of engineered systems. In this paper, we describe two algorithms
    based on a qualitative event-based fault isolation framework augmented with model-based
    fault identification that are applied to spacecraft power distribution systems.
    Although based on a common framework, the fundamental difference between the two
    algorithms is that one uses a global model for residual generation, fault isolation,
    and fault identification; whereas the other uses a set of minimal submodels computed
    using Possible Conflicts. We describe the implementation of the two algorithms and
    compare their diagnosis results on a representative spacecraft power distribution
    system.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
